// eslint-disable-next-line import/no-anonymous-default-export
export default (posts = [], action) => {
    console.log("action", action)
    console
    switch (action.type) {
        case 'FETCH_ALl':
            return action.payload;
        case 'CREATE':
            return [posts, action.payload];
        default:
            return posts;
    }
}
